// Constants
var outputTextElement = document.querySelector("#outputText");
var inputTextElement = document.querySelector("#inputText");
var split_words = function (s) {
    return s.split("");
};
var get_tocfl_level = function (word) {
    var word_length = word.length;
    var level = data[word_length.toString()][word];
    if (typeof level === "undefined") {
        return 0;
    }
    else {
        return level;
    }
};
var remove_all_children = function (element) {
    while (element.firstChild) {
        element.firstChild.remove();
    }
};
var make_textarea_fit_content = function (event) {
    var element = event.target;
    element.style.height = "";
    element.style.height = element.scrollHeight + "px";
};
var get_event_value = function (event) {
    return event.target.value;
};
var main = function (event) {
    make_textarea_fit_content(event);
    var inputText = get_event_value(event);
    var wordArray = split_words(inputText);
    var tocflLevelArray = wordArray.map(get_tocfl_level);
    remove_all_children(outputTextElement);
    for (var i = 0; i < wordArray.length; i++) {
        var wordElement = document.createElement("span");
        wordElement.className = "level" + tocflLevelArray[i].toString();
        wordElement.appendChild(document.createTextNode(wordArray[i]));
        outputTextElement.appendChild(wordElement);
    }
};
inputTextElement.addEventListener("input", function (event) {
    main(event);
});
